CREATE TABLE students (
    id INT PRIMARY KEY AUTO_INCREMENT,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    age INT,
    gender CHAR(1),
    grade CHAR(1),
    city VARCHAR(50),
    state VARCHAR(50),
    country VARCHAR(50),
    email VARCHAR(100),
    phone VARCHAR(15),
    enrollment_date DATE,
    graduation_year INT,
    major VARCHAR(50),
    gpa DECIMAL(3,2), 
    credits_completed INT,
    scholarship_status BOOLEAN,
    part_time_job BOOLEAN,
    extracurriculars VARCHAR(100),
    remarks TEXT
);

 